INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 10118, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 40, 1, "ペコリーヌとの出会い", 0, 2, "フリーマーケット会場", "青空の下で謁見", 91002, 2834, 5118061, 8, 7);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 10118, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 40, 1, "マホとの出会い", 0, 2, "フリーマーケット会場", "未来の騎空団\nマスコット？", 91002, 2835, 5118062, 8, 7);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 10118, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 40, 1, "アキノとの出会い", 0, 2, "ランドソル市街地", "お嬢さまからの\n緊急依頼", 91002, 2837, 5118063, 8, 7);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 10118, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 40, 1, "ジュンとの出会い", 0, 2, "フリーマーケット会場", "黄金色の悩みごと", 91002, 4108402, 5118064, 8, 18);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 10118, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 40, 1, "カオリとの出会い", 0, 2, "フリーマーケット会場", "白熱！　格闘大会！", 91002, 4107402, 5118065, 8, 18);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 10118, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 40, 1, "ニノンとの出会い", 0, 2, "オーエド町", "祭り太鼓はオーエドの華", 91002, 9000227, 5118066, 8, 16);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 10118, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 40, 1, "スズナとの出会い", 0, 3, "フリーマーケット会場", "人気者は遅れて\nやってくる", 91002, 2101181, 5118067, 8, 19);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 10118, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 40, 1, "ナナカとの出会い", 0, 3, "ランドソル市街地", "巫女・ミーツ・魔法少女", 91002, 4109402, 5118068, 8, 18);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 10118, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 40, 1, "キャル＆コッコロとの出会い", 0, 3, "フリーマーケット会場", "ネズ耳は二度なくなる", 91002, 4305402, 5118069, 8, 18);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 10118, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 40, 1, "ユカリとの出会い", 0, 3, "ランドソル市街地", "この出会いにカンパイ！", 91002, 4101402, 5118070, 8, 18);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 10118, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 40, 1, "アオイとの出会い", 0, 3, "ランドソル市街地", "陰陽アンサンブル", 91002, 4106402, 5118071, 8, 18);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 10118, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 40, 1, "シノブとの出会い", 0, 3, "フリーマーケット会場", "運試し十番勝負！", 91002, 2836, 5118072, 8, 7);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 10118, 0, 0, 0, "オープニング", 10145115, 1, 0, "彼女たちの新たな日常", 0, 0, 5118600, 0, 0);
